var TLETimestampSec=msg.payload/1000;
// convert the timestamp of the new TLE in sec
var endDateSec=msg.datesStartEnd[1];
// extrqct the enddate
var aDayinSec=86400;
// store number of sec in a day
var dayBeforeStartSec=msg.datesStartEnd[0]-aDayinSec;
// compute the time stamp of a day before the startdate
if(TLETimestampSec>endDateSec){
    msg.errorMessage="TLE date greater than end of sim";
    msg.errorFlag=true;
}
else if(!(Number.isInteger(TLETimestampSec))){
    msg.errorMessage="TLE date is note a number";
    msg.errorFlag=true;
}
else if(TLETimestampSec<dayBeforeStartSec){
    msg.errorMessage="TLE date too old";
    msg.errorFlag=true;
}
else{
    msg.errorMessage="TLE timestamp updated ";
    msg.errorFlag=false;
    msg.payload=msg.payload;
}

//because of the join wait we need to move from msg.payload
//msg.dateTLE=msg.payload;
return msg;

msg.delay=0;
