function getDayOfYear(date) {
  var start = new Date(Date.UTC(date.getUTCFullYear(), 0, 0));
  var diff = date - start;
  var oneDay = 1000 * 60 * 60 * 24;
  var dayOfYear = Math.floor(diff / oneDay);

  return dayOfYear;
}

